import { PageMain, SimpleGrid } from "core";
import React, { Component } from "react";
import constants from "../../utils/constants";
import NotificationSystem from "react-notification-system";

export default class BaseDataListPage extends Component {
  constructor(props) {
    super(props);
    this.state = { isLoading: false, updateKey: 1, headers: [] };
    this.pageInfo = {
      title: "گزارش",
      icon: "list-search",
    };
    this.notificationSystem = React.createRef();
  }

  //#region  //ترمینال  //////////////////////////
  // ACQINST
  // ACCEPTORID
  // TERMID
  // TERMINAL_TYPE
  // ACTIVE
  // INSTALLATION_DATE
  // DESCRIPTION
  // CREATED
  // UPDATED
  //#endregion

  //#region //پذیرنده  //////////////////////////
  // ACQINST
  // ACCEPTORID
  // CATEGORY_CODE
  // ACTIVE
  // DEFINITON_DATE
  // NAME_EN
  // NAME_FA
  // STREET_ADDRESS_EN
  // STREET_ADDRESS_FA
  // ADDITIONAL_ADDRESS_EN
  // ADDITIONAL_ADDRESS_FA
  // CITY_EN
  // CITY_FA
  // PROVINCE_CODE
  // COUNTRY_CODE
  // POSTAL_CODE
  // PHONE
  // FAX
  // CUSTOMER_SERVICE_PHONE
  // ADDITIONAL_CONTACT_INFO
  // EMAIL_ADDRESS
  // INTERNET_URL
  // BANKID
  // MAX_TXN_AMT
  // MIN_TXN_AMT
  // CANCELLATION_ALLOWED
  // REFUND_ALLOWED
  // NUMBER_BLOCK_ALLOWED
  // CHARGBACK_ALLOWED
  // BIC
  // CREATED
  //UPDATE
  //#endregion

  //#region //شبای پذیرنده /////////////////
  // ACOINST,
  // ACCEPTORID,
  // IBAN_NUMBER,
  // ACTIVE,
  // CREATED,
  // UPDATED,
  // DEFINITION_DATE,
  // DESCRIPTION,
  // FILLER1,
  // FILLER2,
  // FILLER3
  //#endregion

  //#region خودپرداز ///////////////////
  //   BANK_CODE,
  //   ATM_CODE,
  //   OSTAN_CODE,
  //   OSTAN_NAME,
  //   CITY_CODE,
  //   CITY_NAME,
  //   BRANCH_CODE,
  //   BRANCH_NAME,
  //   LOCATION,
  //   SECURITY,
  //   FEATURE_CODE,
  //   FEATURE_DESC,
  //   FILLER1,
  //   FILLER2,
  //   FILLER3
  //#endregion

  onReportTypeSelected = () => {
    let reportTypeId = this.props.reportTypeId;

    switch (reportTypeId) {
      case 1:
        //خودپرداز ///////////////////
        this.state.headers = [
          { title: "BANK_CODE", name: "bankCode" },
          { title: "ATM_CODE", name: "atmCode" },
          { title: "OSTAN_CODE", name: "ostanCode" },
          { title: "OSTAN_NAME", name: "ostanName" },
          { title: "CITY_CODE", name: "cityCode" },
          { title: "CITY_NAME", name: "cityName" },
          { title: "BRANCH_CODE", name: "branchCode" },
          { title: "BRANCH_NAME", name: "branchName" },
          { title: "LOCATION", name: "location" },
          { title: "SECURITY", name: "security" },
          { title: "FEATURE_CODE", name: "featureCode" },
          { title: "FEATURE_DESC", name: "featureDesc" },
          { title: "FILLER1", name: "filter1" },
          { title: "FILLER2", name: "filter2" },
          { title: "FILLER3", name: "filter3" },
        ];
        break;
      //شبای پذیرنده /////////////////
      case 2:
        this.state.headers = [
          { title: "ACOINST", name: "acoinst" },
          { title: "ACCEPTORID", name: "acceptorId" },
          { title: "IBAN_NUMBER", name: "ibanNumber" },
          { title: "ACTIVE", name: "active" },
          { title: "CREATED", name: "created" },
          { title: "UPDATED", name: "updated" },
          { title: "DEFINITION_DATE", name: "definitionDate" },
          { title: "DESCRIPTION", name: "description" },
          { title: "FILLER1", name: "filter1" },
          { title: "FILLER2", name: "filter2" },
          { title: "FILLER3", name: "filter3" },
        ];
        break;
      //ترمینال  //////////////////////////
      case 3:
        this.state.headers = [
          { title: "ACQINST", name: "axqinst" },
          { title: "ACCEPTORID", name: "acceptorId" },
          { title: "TERMID", name: "termid" },
          { title: "TERMINAL_TYPE", name: "terminalType" },
          { title: "ACTIVE", name: "active" },
          { title: "INSTALLATION_DATE", name: "installationDate" },
          { title: "DESCRIPTION", name: "description" },
          { title: "CREATED", name: "created" },
          { title: "UPDATED", name: "updated" },
        ];
        break;
      // پذیرنده  //////////////////////////نصفههههه
      case 4:
        this.state.headers = [
          { title: "ACQINST", name: "acqinst" },
          { title: "ACCEPTORID", name: "acceptorId" },
          { title: "CATEGORY_CODE", name: "categoryCode" },
          { title: "ACTIVE", name: "active" },
          { title: "DEFINITON_DATE", name: "definitonDate" },
          { title: "NAME_EN", name: "nameEn" },
          { title: "NAME_FA", name: "nameFa" },
          { title: "STREET_ADDRESS_EN", name: "streetAddressEn" },
          { title: "STREET_ADDRESS_FA", name: " streetAddressFa" },
          { title: "ADDITIONAL_ADDRESS_EN", name: "additionalAddressEn" },
          { title: "ADDITIONAL_ADDRESS_FA", name: "additionalAddressFa" },
          { title: "CITY_EN", name: "cityEn" },
          { title: "CITY_FA", name: "cityFa" },
          { title: "PROVINCE_CODE", name: "provinceCode" },
          { title: "COUNTRY_CODE", name: "countryCode" },
          { title: "POSTAL_CODE", name: "postalCode" },
          { title: "PHONE", name: "phone" },
          { title: "FAX", name: "fax" },
          { title: "CUSTOMER_SERVICE_PHONE", name: "customerServicePhone" },
          { title: "ADDITIONAL_CONTACT_INFO", name: "additionalContactInfo" },
          { title: "EMAIL_ADDRESS", name: "emailAddress" },
          { title: "INTERNET_URL", name: "internetUrl" },
          { title: "BANKID", name: "bankId" },
          { title: "MAX_TXN_AMT", name: "maxTxnAmt" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
          { title: "کد شغل", name: "jobId" },
        ];
        break;

      case 5:
        this.state.headers = [
          { title: "شرح وضعیت حساب", name: "accountStatusName" },
          { title: "کد وضعیت حساب", name: "depositeStatus" },
        ];
        break;

      case 6:
        this.state.headers = [
          { title: "شرح نوع مشتری", name: "customerTypeName" },
          { title: "نوع مشتری", name: "customerType" },
        ];
        break;

      case 7:
        this.state.headers = [
          { title: "نام حساب", name: "role9" },
          { title: "کد حساب", name: "provinceName" },
        ];
        break;

      case 8:
        this.state.headers = [
          { title: "نام کشور", name: "provinceCode" },
          { title: "شناسه", name: "role3" },
        ];
        break;

      case 9:
        this.state.headers = [
          { title: "کد وضعیت", name: "isActive" },
          { title: "نام شهر", name: "cityName" },
          { title: "کد شهر", name: "cityCode" },
        ];
        break;

      case 10:
        this.state.headers = [
          { title: "وضعیت سطح تحصیلات", name: "role10" },
          { title: "شناسه سطح تحصیلات", name: "role9" },
        ];
        break;

      case 11:
        this.state.headers = [
          { title: "نام استان", name: "provinceName" },
          { title: "کد استان", name: "provinceCode" },
        ];
        break;

      case 12:
        this.state.headers = [
          { title: "شرح", name: "role3" },
          { title: "کد", name: "role4" },
        ];
        break;

      case 13:
        this.state.headers = [
          { title: "شرح فروشنده", name: "role5" },
          { title: "کد فروشنده", name: "role6" },
        ];
        break;

      case 14:
        this.state.headers = [
          { title: "نام شغل", name: "jobName" },
          { title: "شناسه", name: "jobId" },
        ];
        break;
    }
  };

  render() {
    return (
      <>
        <PageMain
          title={this.pageInfo.title}
          icon={this.pageInfo.icon}
          isLoading={this.state.isLoading}
          footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
          key={this.state.updateKey}
        >
          <SimpleGrid
            context={this}
            minHeightTableWrapper={constants.MinGridHeight}
            filterBgColor="primary"
            name="reportList"
            title="گزارش"
            listApiUrl="/api/amls/bi/Receive_STR_/SearchPersonReceive_STR"
            // extraItemsSentToFetchData={{
            //   reportTypeId: this.state.eportTypeId,
            // }}
            headers={this.state.headers}
            enableAutoFetch
            filterOptions={null}
            notificationSystem={this.notificationSystem}
          />
        </PageMain>
        <NotificationSystem ref={this.notificationSystem} />
      </>
    );
  }
}
